export default[{
    path: '/workorder',
    name: 'workorder',
    component: resolve => require(["@/views/index"], resolve),
    children:[
        {
            //用户消息
            path:'/workOrder_detail',
            name:'workOrder_detail',
            component:resolve => require(['@/views/workorder/category/workOrder_detail.vue'],resolve),
            meta:{
                title:'工单详情页'
            }
        },{
            //用户消息
            path:'/workOrder_detail_dispose',
            name:'workOrder_detail_dispose',
            component:resolve => require(['@/views/workorder/category/workOrder_detail_dispose'],resolve),
            meta:{
                title:'工单处理页'
            }
        },{
            //用户消息
            path:'/workOrder_pending_list',
            name:'workOrder_pending_list',
            component:resolve => require(['@/views/workorder/category/workOrder_pending_list'],resolve),
            meta:{
                title:'待处理工单'
            }
        },{
            //用户消息
            path:'/workOrder_new_list',
            name:'workOrder_new_list',
            component:resolve => require(['@/views/workorder/config/workOrder_new_list'],resolve),
            meta:{
                title:'工单类型扩展表单'
            }
        },{
            //用户消息
            path:'/workOrder_time_list',
            name:'workOrder_time_list',
            component:resolve => require(['@/views/workorder/config/workOrder_time_list'],resolve),
            meta:{
                title:'工单时间管理'
            }
        },{
            //用户消息
            path:'/workOrder_add',
            name:'workOrder_add',
            component:resolve => require(['@/views/workorder/config/workOrder_add'],resolve),
            meta:{
                title:'新增扩展表单'
            }
        },{
            //用户消息
            path:'/workOrder_redact',
            name:'workOrder_redact',
            component:resolve => require(['@/views/workorder/config/workOrder_redact'],resolve),
            meta:{
                title:'编辑扩展表单'
            }
        },{
            //用户消息
            path:'/workOrder_time_add',
            name:'workOrder_time_add',
            component:resolve => require(['@/views/workorder/config/workOrder_time_add'],resolve),
            meta:{
                title:'新增工单时限'
            }
        },{
            //用户消息
            path:'/workOrder_time_redact',
            name:'workOrder_time_redact',
            component:resolve => require(['@/views/workorder/config/workOrder_time_redact'],resolve),
            meta:{
                title:'编辑工单时限'
            }
        }
    ]
}]
